import { Router, Link } from "@reach/router";
import { LinkButton } from '../styles/Links'
import styled from 'styled-components'

const AdjustHome = styled.div`
padding: 0 30%;
    display: flex;
    justify-content: space-between;
    margin-top: 10em;
    //width: 100%;
`;

const HomeContainer = styled.div`
    margin-top: 8%;
    display: flex;
    flex-flow: column;
    // justify-content: center;
    width: 60%;

`;


const Home = () => {
    // Declare a new state constiable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <AdjustHome>
            {/* <HomeContainer> */}
                <LinkButton to="slots">Slots Generation</LinkButton>
                <LinkButton to="csv">Csv Generation</LinkButton>
                <LinkButton to="config">Config Generation</LinkButton>
            {/* </HomeContainer> */}
        </AdjustHome >
    );
}

export { Home };
